// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract GameEnrollment {
  
  uint public validPunkId;
  uint public rentAmount;
  uint public enrollmentId;
  address public gameAddress;
  address public nftAddress;
  address public owner;
  bool public rentBegin;
  bool public isGameOver;

  mapping (address => uint) public stakingBalanceOf;
  mapping (uint => address) public holderOf;
  mapping (address => uint[]) private _rentPunksOf;
  mapping (address => uint[]) private _registerPunksOf;
  mapping (uint => bool) public isRegister;

  event Deposit(address indexed user, uint amount);
  event Withdraw(address indexed user, uint amount);
  event EnrollmentGame(uint indexed id, address indexed player, uint indexed punkId, string name, string uri);
  
  constructor(address game_, address nft_) {
    gameAddress = game_;
    nftAddress = nft_;
    rentAmount = 1e18;
    validPunkId = 1;
    owner = msg.sender;
  }

  function rentPunksOf(address user) public view returns (uint[] memory) {
    return _rentPunksOf[user];
  }

  function registerPunksOf(address user) public view returns (uint[] memory) {
    return _registerPunksOf[user];
  }
  
  function setGameOver(bool b) public {
    require(msg.sender == owner, "You are not admin");
    isGameOver = b;
  }

  function setRentBegin(bool b) public {
    require(msg.sender == owner, "You are not admin");
    rentBegin = b;
  }
  
  function rentPunk() public {
    require(rentBegin, "rent not begin");
    while (holderOf[validPunkId] != address(0)) {
      validPunkId ++;
    }
    require(validPunkId <= 667, "All punk are rent now");
    IERC20 token = IERC20(gameAddress);
    require(token.transferFrom(msg.sender, address(this), rentAmount), "Game transfer failed");
    stakingBalanceOf[msg.sender] += rentAmount;
    holderOf[validPunkId] = msg.sender;
    _rentPunksOf[msg.sender].push(validPunkId);
    emit Deposit(msg.sender, rentAmount);
  }
  
  function enrollmentGame(address player_, uint id_, string memory name_) public {
    IERC721Metadata nft = IERC721Metadata(nftAddress);
    if (!rentBegin && msg.sender == nft.ownerOf(id_)) {
      holderOf[id_] = msg.sender;
    }
    require(holderOf[id_] == msg.sender, "Only holder can authorize his punk!");
    enrollmentId ++;
    isRegister[id_] = true;
    _registerPunksOf[msg.sender].push(id_);
    emit EnrollmentGame(enrollmentId, player_, id_, name_, nft.tokenURI(id_));
  }

  function withdrawGame() public {
    require(isGameOver, "Wait until game is over");  
    uint amount = stakingBalanceOf[msg.sender];
    stakingBalanceOf[msg.sender] = 0;
    IERC20 token = IERC20(gameAddress);
    require(token.transfer(msg.sender, amount), "Game transfer failed");
    emit Withdraw(msg.sender, amount);
  }
  
}
